import React from 'react';
import { withStyles } from "@material-ui/styles"

//Define Styles here↓
const styles = {
  root:{

  },
  container:{
    width:"100%",
    height:"430px",
    background:"grey"
  }
}

function Card(props) {
  const { classes,title,intro } = props;
  return (
    <div className={classes.root}>
      <div className={ classes.container }>
        <h1>{title}</h1>
        <p>{intro}</p>
      </div>
    </div>
  );
}

export default withStyles(styles)(Card);
